import styles from "./ContactList.module.css"

function ContactList(props) {
    return (
        <div className={styles.card}>
           <ul>
            {
                props.arr.map((item) => {
                    return (
                        <ul>
                            <li>{item.name}</li>
                        </ul>
                    )
                })
            }
           </ul>
        </div>
    )
}

export default ContactList
